CREATE TABLE HomeGames(
   yearkey    INTEGER  NOT NULL PRIMARY KEY 
  ,leaguekey  VARCHAR(2) NOT NULL
  ,teamkey    VARCHAR(3) NOT NULL
  ,parkkey    VARCHAR(5) NOT NULL
  ,spanfirst  VARCHAR(10) NOT NULL
  ,spanlast   VARCHAR(10) NOT NULL
  ,games      INTEGER  NOT NULL
  ,openings   INTEGER  NOT NULL
  ,attendance INTEGER  NOT NULL
);
